import React from 'react';

function Footer() {
  return (
    <footer>
      <ul>
        <li>
          <a href="https://github.com/yourusername">GitHub</a>
        </li>
        <li>
          <a href="https://linkedin.com/in/yourusername">LinkedIn</a>
        </li>
        <li>
          <a href="https://yourwebsite.com">Your Website</a>
        </li>
      </ul>
    </footer>
  );
}

export default Footer;
